在您的 Foundry 项目工作目录中： npm init -y - 这将设置一个 package.json 文件。 npm i --save-dev hardhat - 将 Hardhat 作为开发依赖项安装到您的项目中。 npx hardhat init - 在同一目录中初始化您的 Hardhat 项目，并选择“ Create an empty hardhat.config.js ”选项。这将创建一个基本的 hardhat.config.js 文件。 npm i --save-dev @nomicfoundation/hardhat-foundry @nomicfoundation/hardhat-toolbox - 这将安装 hardhat-foundry 插件和 Hardhat 工具箱插件，这是运行 Hardhat 测试所需的所有基本依赖项的组合。 您的 hardhat.config.js 文件应如下所示以使插件工作： require("@nomicfoundation/hardhat-toolbox");
require("@nomicfoundation/hardhat-foundry");
/** @type import('hardhat/config').HardhatUserConfig */
module.exports = { solidity: "0.8.19",
}; 默认情况下，Foundry 项目附带一个简单的 Counter.sol 合约和几个测试。在与默认 Counter.t.sol 文件平行的 test 目录中创建一个名为 Counter.t.js 的文件。 将以下代码添加到 Counter.t.js 文件中： const { expect } = require("chai");
const hre = require("hardhat");
const { loadFixture } = require("@nomicfoundation/hardhat-toolbox/network-helpers"); describe("Counter contract", function () { async function CounterLockFixture() { const counter = await ethers.deployContract("Counter"); await counter.setNumber(0); return { counter }; } it("Should increment the number correctly", async function () { const { counter } = await loadFixture(CounterLockFixture); await counter.increment(); expect(await counter.number()).to.equal(1); }); // 这不是模糊测试，因为 Hardhat 尚不支持模糊测试。 it("Should set the number correctly", async function () { const { counter } = await loadFixture(CounterLockFixture); await counter.setNumber(100); expect(await counter.number()).to.equal(100); });
}); 这段代码将执行与默认 Counter.t.sol 文件相同的测试。 就是这样！ 您可以在同一个 test 目录中创建 Hardhat 和 Foundry 测试，并分别使用 npx hardhat test 和 forge test 运行它们。 查看 Hardhat 的文档 以了解更多信息。

