1557.body:
JSON对象编码为元组，可以通过元组或结构体解码。这意味着你可以在Solidity中定义一个struct，它将整个JSON对象解码为该struct。 例如： 以下JSON： { "a": 43, "b": "sigma"
} 将被解码为： struct Json { uint256 a; string b;
} 由于值作为abi编码的元组返回，结构体属性的确切名称不需要与JSON中的键名称匹配。上述json文件也可以解码为： struct Json { uint256 apple; string pineapple;
} 重要的是字母顺序。由于JSON对象是无序的数据结构，而元组是有序的，我们必须以某种方式为JSON赋予顺序。最简单的方法是按字母顺序排序键。这意味着为了正确解码JSON对象，你需要定义结构体的属性 类型 ，这些类型对应于JSON键的字母顺序的值。 结构体是按顺序解释的。这意味着元组的第一个项目将根据结构体定义的第一个项目解码（不按字母顺序）。 JSON将按字母顺序解析，而不是按顺序。 请注意，此解析使用Rust的BTreeMap crate，这意味着大写和小写字符的处理方式不同。大写字符 优先 于小写字符，即“Zebra“会优先于“apple“。 因此，JSON的第一个（按字母顺序）值将被abi编码，然后根据struct的第一个属性的类型尝试abi解码。 上述JSON无法用以下结构体解码： struct Json { uint256 b; uint256 a;
} 原因是它会尝试将字符串"sigma"解码为uint。确切地说，它会解码，但会得到一个错误的数字，因为它会错误地解释字节。 另一个例子，给定以下JSON： { "apples": [ { "sweetness": 7, "sourness": 3, "color": "Red" }, { "sweetness": 5, "sourness": 5, "color": "Green" }, { "sweetness": 9, "sourness": 1, "color": "Yellow" } ], "name": "Fresh Fruit"
} 并定义如下Solidity结构体： struct Apple { string color; uint8 sourness; uint8 sweetness;
} struct FruitStall { Apple[] apples; string name;
} 可以如下解码JSON： string memory root = vm.projectRoot();
string memory path = string.concat(root, "/src/test/fixtures/fruitstall.json");
string memory json = vm.readFile(path);
bytes memory data = vm.parseJson(json);
FruitStall memory fruitstall = abi.decode(data, (FruitStall)); // 日志: Welcome to Fresh Fruit
console2.log("Welcome to", fruitstall.name); for (uint256 i = 0; i < fruitstall.apples.length; i++) { Apple memory apple = fruitstall.apples[i]; // 日志: // Color: Red, Sourness: 3, Sweetness: 7 // Color: Green, Sourness: 5, Sweetness: 5 // Color: Yellow, Sourness: 1, Sweetness: 9 console2.log( "Color: %s, Sourness: %d, Sweetness: %d", apple.color, apple.sourness, apple.sweetness );
}

