error WithdrawTransfer(); contract NFT is ERC721, Ownable { using Strings for uint256; string public baseURI; uint256 public currentTokenId; uint256 public constant TOTAL_SUPPLY = 10_000; uint256 public constant MINT_PRICE = 0.08 ether; constructor( string memory _name, string memory _symbol, string memory _baseURI ) ERC721(_name, _symbol) { baseURI = _baseURI; } function mintTo(address recipient) public payable returns (uint256) { if (msg.value != MINT_PRICE) { revert MintPriceNotPaid(); } uint256 newTokenId = currentTokenId + 1; if (newTokenId > TOTAL_SUPPLY) { revert MaxSupply(); } currentTokenId = newTokenId; _safeMint(recipient, newTokenId); return newTokenId; } function tokenURI(uint256 tokenId) public view virtual override returns (string memory) { if (ownerOf(tokenId) == address(0)) { revert NonExistentTokenURI(); } return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, tokenId.toString())) : ""; } function withdrawPayments(address payable payee) external onlyOwner { if (address(this).balance == 0) { revert WithdrawTransfer(); } payable(payee).transfer(address(this).balance); } function _checkOwner() internal view override { require(msg.sender == owner(), "Ownable: caller is not the owner"); }
} 除了其他功能外，我们还添加了可以通过任何前端应用程序（如 OpenSea）查询的元数据，通过调用 NFT 合约上的 tokenURI 方法。 注意 ：如果您想在部署时提供一个真实的 URL 到构造函数，并托管此 NFT 合约的元数据，请按照 此处 概述的步骤操作。 让我们测试一些添加的功能，以确保它们按预期工作。Foundry 通过 Forge 提供了一个极快的 EVM 原生测试框架。 在您的测试文件夹中，将当前的 Contract.t.sol 测试文件重命名为 NFT.t.sol。该文件将包含所有关于 NFT 的 mintTo 方法的测试。接下来，用以下内容替换现有的样板代码： // SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.10; import "forge-std/Test.sol";
import "../src/NFT.sol"; contract NFTTest is Test { using stdStorage for StdStorage; NFT private nft; function setUp() public { // Deploy NFT contract nft = new NFT("NFT_tutorial", "TUT", "baseUri"); } function test_RevertMintWithoutValue() public { vm.expectRevert(MintPriceNotPaid.selector); nft.mintTo(address(1)); } function test_MintPricePaid() public { nft.mintTo{value: 0.08 ether}(address(1)); } function test_RevertMintMaxSupplyReached() public { uint256 slot = stdstore .target(address(nft)) .sig("currentTokenId()") .find(); bytes32 loc = bytes32(slot); bytes32 mockedCurrentTokenId = bytes32(abi.encode(10000)); vm.store(address(nft), loc, mockedCurrentTokenId); vm.expectRevert(MaxSupply.selector); nft.mintTo{value: 0.08 ether}(address(1)); } function test_RevertMintToZeroAddress() public { vm.expectRevert("INVALID_RECIPIENT"); nft.mintTo{value: 0.08 ether}(address(0)); } function test_NewMintOwnerRegistered() public { nft.mintTo{value: 0.08 ether}(address(1)); uint256 slotOfNewOwner = stdstore .target(address(nft)) .sig(nft.ownerOf.selector) .with_key(address(1)) .find(); uint160 ownerOfTokenIdOne = uint160( uint256( (vm.load(address(nft), bytes32(abi.encode(slotOfNewOwner)))) ) ); assertEq(address(ownerOfTokenIdOne), address(1)); } function test_BalanceIncremented() public { nft.mintTo{value: 0.08 ether}(address(1)); uint256 slotBalance = stdstore .target(address(nft)) .sig(nft.balanceOf.selector) .with_key(address(1)) .find(); uint256 balanceFirstMint = uint256( vm.load(address(nft), bytes32(slotBalance)) ); assertEq(balanceFirstMint, 1); nft.mintTo{value: 0.08 ether}(address(1)); uint256 balanceSecondMint = uint256( vm.load(address(nft), bytes32(slotBalance)) ); assertEq(balanceSecondMint, 2); } function test_SafeContractReceiver() public { Receiver receiver = new Receiver(); nft.mintTo{value: 0.08 ether}(address(receiver)); uint256 slotBalance = stdstore .target(address(nft)) .sig(nft.balanceOf.selector) .with_key(address(receiver)) .find(); uint256 balance = uint256(vm.load(address(nft), bytes32(slotBalance))); assertEq(balance, 1); } function test_RevertUnSafeContractReceiver() public { // Adress set to 11, because first 10 addresses are restricted for precompiles vm.etch(address(11), bytes("mock code")); vm.expectRevert(bytes("")); nft.mintTo{value: 0.08 ether}(address(11)); } function test_WithdrawalWorksAsOwner() public { // Mint an NFT, sending eth to the contract Receiver receiver = new Receiver(); address payable payee = payable(address(0x1337)); uint256 priorPayeeBalance = payee.balance; nft.mintTo{value: nft.MINT_PRICE()}(address(receiver)); // Check that the balance of the contract is correct assertEq(address(nft).balance, nft.MINT_PRICE()); uint256 nftBalance = address(nft).balance; // Withdraw the balance and assert it was transferred nft.withdrawPayments(payee); assertEq(payee.balance, priorPayeeBalance + nftBalance); } function test_WithdrawalFailsAsNotOwner() public { // Mint an NFT, sending eth to the contract Receiver receiver = new Receiver(); nft.mintTo{value: nft.MINT_PRICE()}(address(receiver)); // Check that the balance of the contract is correct assertEq(address(nft).balance, nft.MINT_PRICE()); // Confirm that a non-owner cannot withdraw vm.expectRevert("Ownable: caller is not the owner"); vm.startPrank(address(0xd3ad)); nft.withdrawPayments(payable(address(0xd3ad))); vm.stopPrank(); }
} contract Receiver is ERC721TokenReceiver { function onERC721Received( address operator, address from, uint256 id, bytes calldata data ) external override returns (bytes4) { return this.onERC721Received.selector; }
} 测试套件设置为一个合约，其中 setUp 方法在每个单独的测试之前运行。 如您所见，Forge 提供了许多 作弊码 来操纵状态以适应您的测试场景。 例如，我们的 testFailMaxSupplyReached 测试检查当 NFT 的最大供应量达到时尝试铸造是否失败。因此，需要使用存储作弊码将 NFT 合约的 currentTokenId 设置为最大供应量，该作弊码允许您写入合约的存储槽。可以使用 forge-std 帮助库轻松找到要写入的存储槽。您可以使用以下命令运行测试： forge test 如果您想将 Forge 技能付诸实践，请为 NFT 合约的其余方法编写测试。欢迎将它们 PR 到 nft-tutorial，您将在其中找到本教程的完整实现。

