forge install transmissions11/solmate Openzeppelin/openzeppelin-contracts@v5.0.1 接下来，我们需要删除 src 文件夹中的 Counter.sol 文件，并创建另一个名为 NFT.sol 的文件。你可以通过运行以下命令来完成： rm src/Counter.sol test/Counter.t.sol && touch src/NFT.sol && ls src 设置命令 完成后，你应该打开你喜欢的代码编辑器，并将下面的代码复制到 NFT.sol 文件中。 // SPDX-License-Identifier: UNLICENSED
