我们将把 NFT 合约部署到 Sepolia 测试网，但为此我们需要配置 Foundry，设置 Sepolia RPC URL、一个有 Sepolia Eth 资金的账户的私钥，以及一个用于验证 NFT 合约的 Etherscan 密钥。 💡 注意：你可以在这里获取一些 Sepolia 测试网 ETH here。 环境配置 一旦你有了所有这些，创建一个 .env 文件并添加变量。Foundry 会自动加载项目目录中存在的 .env 文件。 .env 文件应遵循以下格式： SEPOLIA_RPC_URL=
PRIVATE_KEY=
ETHERSCAN_API_KEY= 现在我们需要编辑 foundry.toml 文件。项目根目录中应该已经有一个。 在文件末尾添加以下行： [rpc_endpoints]
sepolia = "${SEPOLIA_RPC_URL}" [etherscan]
sepolia = { key = "${ETHERSCAN_API_KEY}" } 这为 Sepolia 创建了一个 RPC 别名 并加载了 Etherscan API 密钥。 编写脚本 接下来，我们需要创建一个文件夹并命名为 script，并在其中创建一个名为 NFT.s.sol 的文件。这是我们将创建部署脚本的地方。 NFT.s.sol 的内容应如下所示： // SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13; import "forge-std/Script.sol";
import "../src/NFT.sol"; contract MyScript is Script { function run() external { uint256 deployerPrivateKey = vm.envUint("PRIVATE_KEY"); vm.startBroadcast(deployerPrivateKey); NFT nft = new NFT("NFT_tutorial", "TUT", "baseUri"); vm.stopBroadcast(); }
} 现在让我们阅读代码并弄清楚它的实际含义和作用。 // SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13; 记住，即使这是一个脚本，它仍然像一个智能合约一样工作，但从未部署，所以就像任何其他用 Solidity 编写的智能合约一样，必须指定 pragma version。 import "forge-std/Script.sol";
import "../src/NFT.sol"; 就像我们可能在编写测试时导入 Forge Std 以获取测试工具一样，Forge Std 也提供了一些脚本工具，我们在这里导入。 下一行只是导入 NFT 合约。 contract MyScript is Script { 我们创建了一个名为 MyScript 的合约，并继承了 Forge Std 中的 Script。 function run() external { 默认情况下，脚本通过调用名为 run 的函数来执行，这是我们的入口点。 uint256 deployerPrivateKey = vm.envUint("PRIVATE_KEY"); 这从我们的 .env 文件中加载私钥。 注意： 在 .env 文件中暴露私钥并将其加载到程序中时必须小心。这仅推荐用于非特权部署者或在本地 / 测试设置中使用。对于生产设置，请查看 Foundry 支持的各种 钱包选项 。 vm.startBroadcast(deployerPrivateKey); 这是一个特殊的作弊码，记录由我们的主脚本合约进行的调用和合约创建。我们传递 deployerPrivateKey 以指示它使用该密钥签署交易。稍后，我们将广播这些交易以部署我们的 NFT 合约。 NFT nft = new NFT("NFT_tutorial", "TUT", "baseUri"); 这里我们只是创建了我们的 NFT 合约。因为我们在这行之前调用了 vm.startBroadcast()，合约创建将被 Forge 记录，正如前面提到的，我们可以广播交易以在链上部署合约。广播交易日志将默认存储在 broadcast 目录中。你可以通过在 foundry.toml 文件中设置 broadcast 来更改日志位置。 现在你已经了解了脚本智能合约的作用，让我们运行它。 你应该已经将前面提到的变量添加到 .env 文件中，以便下一部分能够工作。 在项目根目录运行： # 加载 .env 文件中的变量
source .env # 部署并验证我们的合约
forge script --chain sepolia script/NFT.s.sol:MyScript --rpc-url $SEPOLIA_RPC_URL --broadcast --verify -vvvv Forge 将运行我们的脚本并为我们广播交易——这可能需要一段时间，因为 Forge 还会等待交易收据。一分钟左右后，你应该会看到类似这样的内容： 合约已验证 这确认你已成功将 NFT 合约部署到 Sepolia 测试网，并在 Etherscan 上验证了它，所有这些都通过一个命令完成。

