在 src 目录中创建一个名为 Create2.sol 的文件。 初始化一个名为 Create2 的合约，如下所示： // SPDX-License-Identifier: MIT
pragma solidity ^0.8.20; contract Create2 { error Create2EmptyBytecode(); error Create2FailedDeployment();
} 这些错误旨在对工厂部署进行一些合理性检查，并在触发时回滚整个交易。 如果传递给 deploy 函数的字节码为空，则触发 Create2EmptyBytecode() 错误，如果部署因任何原因失败，则触发 Create2FailedDeployment() 错误。 ℹ️ 注意 请注意，CREATE2 部署可能由于多种原因失败。例如，如果字节码无效，或者在计算的地址上已经部署了合约。如果你的构造函数因任何原因回滚，你的部署也可能失败。 接下来，创建一个名为 deploy 的函数： function deploy(bytes32 salt, bytes memory creationCode) external payable returns (address addr) { } 该函数接受两个输入： 用于计算最终地址的 salt。这基本上可以是任何我们想要的随机值。 我们要部署的合约的创建代码。 新部署的合约地址在成功部署后返回。 ℹ️ 注意 你可以使用 CREATE2 向正在部署的合约发送 ETH，但前提是它有一个可支付的构造函数。 如果你尝试在没有可支付构造函数的情况下向其发送 ETH，交易将回滚。 在 deploy 函数的顶部添加这个回滚语句。我们希望如果以下条件不满足，函数拒绝部署请求： if (creationCode.length == 0) { revert Create2EmptyBytecode(); } 接下来，我们将使用内联汇编调用 CREATE2 操作码，这可以使用 assembly 关键字完成： 要调用 内联汇编中的 CREATE2 操作码，我们需要传入四个参数： assembly { addr := create2(callvalue(), add(creationCode, 0x20), mload(creationCode), salt) } 作为部署的一部分，我们要发送到新地址的 ETH 数量。这里我们传入 callvalue()，这是作为交易的一部分发送到工厂合约的 ETH 数量。可以将其视为 msg.value 的低级版本。 第二个和第三个参数指的是我们的字节码所在的内存范围。add(bytecode, 0x20) 接受内存中 bytes 变量字节码位置的引用，并跳过 32 字节（十六进制的 0x20）以指向实际的字节码。 ℹ️ 注意 Solidity 中的 bytes 类型是动态大小的字节数组，其中内存的前 32 字节表示数组的长度，其余字节表示实际数据。因此，当我们传入 bytes 变量的引用时，我们需要跳过前 32 字节以指向实际数据。 在 evm.codes 上阅读更多关于 add 和 mload 操作码的信息。 最后，如果部署因任何原因失败，我们将回滚整个交易，在这种情况下，CREATE2 操作码将返回一个 0 地址： if (addr == address(0)) { revert Create2FailedDeployment(); } 最后，让我们创建一个名为 computeAddress 的视图函数。该函数应接受 salt 和 creationCode 作为参数，并返回使用 deploy 函数部署的合约地址： function computeAddress(bytes32 salt, bytes32 creationCodeHash) external view returns (address addr) { } 在函数内部，粘贴以下代码，该代码使用内联汇编计算地址，执行与 CREATE2 操作码相同的计算： address contractAddress = address(this); assembly { let ptr := mload(0x40) mstore(add(ptr, 0x40), creationCodeHash) mstore(add(ptr, 0x20), salt) mstore(ptr, contractAddress) let start := add(ptr, 0x0b) mstore8(start, 0xff) addr := keccak256(start, 85) } 在尝试理解这里的汇编代码之前，让我们看一下 CREATE2 操作码用于计算地址的公式： keccak256(0xff ++ address ++ salt ++ keccak256(bytecode))[12:] 0xff 是一个硬编码的前缀，防止使用 CREATE 和 CREATE2 部署的地址之间的哈希碰撞。 address 参数指的是调用 CREATE2 操作码的合约地址，在我们的例子中是工厂合约。 这四个参数连接在一起，并使用 keccak256 生成一个 32 字节的哈希。 前 12 字节被截断，剩下的 20 字节用作部署合约的地址。 computeAddress 函数中的整个汇编代码试图在不调用 CREATE2 操作码的情况下重现相同的公式： mload(0x40) 将自由内存指针加载到内存中。这是指向内存数组中下一个自由内存槽的指针。在 Solidity 文档 中阅读更多关于这方面的信息。 mstore(add(ptr, 0x40), bytecodeHash) 从 ptr + 0x40 指向的内存位置开始存储 bytecodeHash，即 ptr + 64 字节。 mstore(add(ptr, 0x20), salt) 在 ptr + 0x20 指向的内存位置存储 salt。 mstore(ptr, contractAddress) 在 ptr 指向的内存位置存储 contractAddress。 ℹ️ 注意 回想一下，传递给 computeAddress 函数的所有参数都是 32 字节长，并在内存中存储为 32 字节值。然而，Solidity 中的地址是 20 字节长，并在内存中存储为 32 字节值，其中前 12 字节被 0 替换。 因此，当我们需要跳过 12 字节以指向实际地址时。 let start := add(ptr, 0x0b) 创建一个新变量 start，指向内存位置 ptr + 0x0b，即 ptr + 11 字节。 最后，mstore8 操作码可用于在内存位置存储单个字节。在这里，我们在 start 指向的内存位置存储值 0xff，该位置占用内存槽的第 12 字节。 将所有值打包到正确的内存位置后，我们现在可以对从 start 开始的内存槽调用 keccak256，并将内存槽的长度作为第二个参数传递。这将返回一个 32 字节的哈希，我们可以截断以获得最终地址。 ℹ️ 注意 你可以查看这个工厂实现的完整代码 这里。 还可以查看 OpenZeppelin 的 CREATE2 库实现，该实现为本教程提供了灵感。 最后，Forge 提供了一些开箱即用的 CREATE2 地址计算辅助函数。查看它们。

