pragma solidity ^0.8.20; import "forge-std/Test.sol";
import {Counter} from "../src/Counter.sol";
import {Create2} from "../src/Create2.sol"; contract Create2Test is Test { } 初始化以下状态变量和 setUp() 函数： Create2 internal create2; Counter internal counter; function setUp() public { create2 = new Create2(); counter = new Counter(); } 创建一个名为 testDeterministicDeploy() 的新函数，该函数： 部署一个新的 Create2 合约实例。 向我们将用于模拟所有后续调用者的特定地址分配 100 ETH，使用 prank 作弊码。 设置 salt 和 bytecode 参数 使用之前部署的 Create2 合约在确定性地址上部署 Counter 合约。 通过断言计算的地址等于部署的地址，检查合约是否部署在正确的地址上。 function testDeterministicDeploy() public { vm.deal(address(0x1), 100 ether); vm.startPrank(address(0x1)); bytes32 salt = "12345"; bytes memory creationCode = abi.encodePacked(type(Counter).creationCode); address computedAddress = create2.computeAddress(salt, keccak256(creationCode)); address deployedAddress = create2.deploy(salt , creationCode); vm.stopPrank(); assertEq(computedAddress, deployedAddress); } 保存所有文件，并使用 forge test --match-path test/Create2.t.sol -vvvv 运行测试。 你的测试应该在没有错误的情况下通过。

