ion": "遇到错误时的初始重试退避时间。" }, { "name": "--no-storage-caching", "description": "显式禁用 RPC 缓存的使用。", "note": "所有存储槽完全从端点读取。请参见 `--fork-url`。" }, { "name": "-v", "alias": "--verbosity", "description": "EVM 的详细程度。", "note": "多次传递以增加详细程度（例如 `-v`, `-vv`, `-vvv`）。", "levels": [ { "level": 2, "description": "打印所有测试的日志" }, { "level": 3, "description": "打印失败测试的执行 traces" }, { "level": 4, "description": "打印所有测试的执行 traces，以及失败测试的设置 traces" }, { "level": 5, "description": "打印所有测试的执行和设置 traces" } ] }, { "name": "--sender", "description": "将执行测试的地址" }, { "name": "--initial-balance", "description": "已部署合约的初始余额" }, { "name": "--ffi", "description": "启用 [FFI cheatcode][ffi-cheatcode]" } ], "links": { "ffi-cheatcode": "../../cheatcodes/ffi.md" }
} #### 执行器选项 `--base-fee <FEE>` `--block-base-fee-per-gas <FEE>` &nbsp;&nbsp;&nbsp;&nbsp;区块中的基础费用（以 wei 为单位）。 `--block-coinbase` *address* &nbsp;&nbsp;&nbsp;&nbsp;区块的 coinbase 地址。 `--block-difficulty` *difficulty* &nbsp;&nbsp;&nbsp;&nbsp;区块的难度。 `--block-gas-limit` *gas_limit* &nbsp;&nbsp;&nbsp;&nbsp;区块的 gas 限制。 `--block-number` *block* &nbsp;&nbsp;&nbsp;&nbsp;区块编号。 `--block-timestamp` *timestamp* &nbsp;&nbsp;&nbsp;&nbsp;区块的时间戳（以秒为单位）。 `--chain-id` *chain_id* &nbsp;&nbsp;&nbsp;&nbsp;链 ID。 `--gas-limit` *gas_limit* &nbsp;&nbsp;&nbsp;&nbsp;区块的 gas 限制。 `--gas-price` *gas_price* &nbsp;&nbsp;&nbsp;&nbsp;gas 价格（以 wei 为单位）。 `--tx-origin` *address* &nbsp;&nbsp;&nbsp;&nbsp;交易的发起方地址。 缓存选项 --force 清除缓存和 artifacts 文件夹并重新编译。 链接器选项 --libraries libraries 设置预链接的库。 参数必须采用 <重映射的库路径>:<库名称>:<地址> 格式，例如 src/Contract.sol:Library:0x...。 也可以在配置文件中设置为 libraries = ["<路径>:<库名称>:<地址>"]。 #### 编译器选项 `--optimize` &nbsp;&nbsp;&nbsp;&nbsp;激活 Solidity 优化器。 `--optimizer-runs` *runs* &nbsp;&nbsp;&nbsp;&nbsp;优化器运行的次数。 `--via-ir` &nbsp;&nbsp;&nbsp;&nbsp;使用 Yul 中间表示编译管道。 `--revert-strings` &nbsp;&nbsp;&nbsp;&nbsp;如何处理 revert 和 require 原因字符串。 `--use` *solc_version* &nbsp;&nbsp;&nbsp;&nbsp;指定 solc 版本或本地 solc 的路径进行构建。 &nbsp;&nbsp;&nbsp;&nbsp;有效值格式为 `x.y.z`、`solc:x.y.z` 或 `path/to/solc`。 `--offline` &nbsp;&nbsp;&nbsp;&nbsp;不访问网络。缺失的 solc 版本不会被安装。 `--no-auto-detect` &nbsp;&nbsp;&nbsp;&nbsp;不自动检测 solc。 `--ignored-error-codes` *error_codes* &nbsp;&nbsp;&nbsp;&nbsp;通过错误代码忽略 solc 警告。参数是以逗号分隔的错误代码列表。 `--extra-output` *selector* &nbsp;&nbsp;&nbsp;&nbsp;在合约的构件中包含的额外输出。 &nbsp;&nbsp;&nbsp;&nbsp;示例键：`abi`、`storageLayout`、`evm.assembly`、`ewasm`、`ir`、`ir-optimized`、`metadata`。 &nbsp;&nbsp;&nbsp;&nbsp;完整描述请参见 [Solidity 文档][output-desc]。 `--extra-output-files` *selector* &nbsp;&nbsp;&nbsp;&nbsp;写入单独文件的额外输出。 &nbsp;&nbsp;&nbsp;&nbsp;示例键：`abi`、`storageLayout`、`evm.assembly`、`ewasm`、`ir`、`ir-optimized`、`metadata`。 &nbsp;&nbsp;&nbsp;&nbsp;完整描述请参见 [Solidity 文档][output-desc]。 `--evm-version` *version* &nbsp;&nbsp;&nbsp;&nbsp;目标 EVM 版本。 [output-desc]: https://docs.soliditylang.org/en/latest/using-the-compiler.html#compiler-api #### 项目选项 `--build-info` &nbsp;&nbsp;&nbsp;&nbsp;生成构建信息文件。 `--build-info-path` *路径* &nbsp;&nbsp;&nbsp;&nbsp;输出路径到构建信息文件将被写入的目录。 `--root` *路径* &nbsp;&nbsp;&nbsp;&nbsp;项目的根路径。默认情况下，这是当前 git 仓库的根目录，或者当前工作目录。 `-C` *路径* `--contracts` *路径* &nbsp;&nbsp;&nbsp;&nbsp;合约源目录。 &nbsp;&nbsp;&nbsp;&nbsp;环境变量: `DAPP_SRC` `--lib-paths` *路径* &nbsp;&nbsp;&nbsp;&nbsp;库文件夹的路径。 `-R` *重映射* `--remappings` *重映射* &nbsp;&nbsp;&nbsp;&nbsp;项目的重映射。 &nbsp;&nbsp;&nbsp;&nbsp;参数是以逗号分隔的重映射列表，格式为 `<源>=<目标>`。 `--cache-path` *路径* &nbsp;&nbsp;&nbsp;&nbsp;编译器缓存的路径。 `--config-path` *文件* &nbsp;&nbsp;&nbsp;&nbsp;配置文件的路径。 `--hh` `--hardhat` &nbsp;&nbsp;&nbsp;&nbsp;这是一个便捷标志，等同于传递 `--contracts contracts --lib-paths node-modules`。 -o path --out path 项目的 artifacts 目录。 --silent 抑制所有输出。 { "id": "display-options", "title": "显示选项"
} 显示选项 -j --json 以 JSON 格式打印部署信息。 #### 常用选项 `-h` `--help` &nbsp;&nbsp;&nbsp;&nbsp;打印帮助信息。

