可以通过创建辅助抽象合约并在测试合约中继承它们来使用共享设置： abstract contract HelperContract { address constant IMPORTANT_ADDRESS = 0x543d...; SomeContract someContract; constructor() {...}
} contract MyContractTest is Test, HelperContract { function setUp() public { someContract = new SomeContract(0, IMPORTANT_ADDRESS); ... }
} contract MyOtherContractTest is Test, HelperContract { function setUp() public { someContract = new SomeContract(1000, IMPORTANT_ADDRESS); ... }
} 💡 提示 使用 getCode 作弊码来部署具有不兼容 Solidity 版本的合约。

70.body:
大多数情况下，仅仅测试智能合约的输出是不够的。为了操纵区块链的状态，以及测试特定的回滚和事件，Foundry 提供了一组作弊码。 作弊码允许你改变区块号、身份等。它们通过在特定地址上调用特定函数来调用：0x7109709ECfa91a80626fF3989D68f67F5b1DD12D。 你可以通过 Forge 标准库中的 Test 合约中可用的 vm 实例轻松访问作弊码。Forge 标准库在后面的 章节 中有更详细的解释。 让我们为一个只能由其所有者调用的智能合约编写测试。 pragma solidity 0.8.10; import "forge-std/Test.sol"; error Unauthorized(); contract OwnerUpOnly { address public immutable owner; uint256 public count; constructor() { owner = msg.sender; } function increment() external { if (msg.sender != owner) { revert Unauthorized(); } count++; }
} contract OwnerUpOnlyTest is Test { OwnerUpOnly upOnly; function setUp() public { upOnly = new OwnerUpOnly(); } function test_IncrementAsOwner() public { assertEq(upOnly.count(), 0); upOnly.increment(); assertEq(upOnly.count(), 1); }
} 如果我们现在运行 forge test，我们会看到测试通过，因为 OwnerUpOnlyTest 是 OwnerUpOnly 的所有者。 $ forge test
Compiling 24 files with Solc 0.8.10
Solc 0.8.10 finished in 1.20s
Compiler run successful! Ran 1 test for test/OwnerUpOnly.t.sol:OwnerUpOnlyTest
[PASS] test_IncrementAsOwner() (gas: 29161)
Suite result: ok. 1 passed; 0 failed; 0 skipped; finished in 510.77µs (66.88µs CPU time) Ran 1 test suite in 2.75ms (510.77µs CPU time): 1 tests passed, 0 failed, 0 skipped (1 total tests) 让我们确保一个绝对不是所有者的人不能增加计数： contract OwnerUpOnlyTest is Test { OwnerUpOnly upOnly; // ... function testFail_IncrementAsNotOwner() public { vm.prank(address(0)); upOnly.increment(); }
} 如果我们现在运行 forge test，我们会看到所有测试都通过了。 $ forge test
No files changed, compilation skipped Ran 2 tests for test/OwnerUpOnly.t.sol:OwnerUpOnlyTest
[PASS] testFail_IncrementAsNotOwner() (gas: 8314)
[PASS] test_IncrementAsOwner() (gas: 29161)
Suite result: ok. 2 passed; 0 failed; 0 skipped; finished in 549.31µs (206.32µs CPU time) Ran 1 test suite in 2.96ms (549.31µs CPU time): 2 tests passed, 0 failed, 0 skipped (2 total tests) 测试通过是因为 prank 作弊码将我们的身份更改为零地址，以便下一次调用（upOnly.increment()）。测试用例通过是因为我们使用了 testFail 前缀，然而，使用 testFail 被认为是一种反模式，因为它没有告诉我们 upOnly.increment() 回滚的任何原因。 如果我们再次运行带有跟踪的测试，我们可以看到我们回滚了正确的错误消息。 $ forge test -vvvv --match-test testFail_IncrementAsNotOwner
No files changed, compilation skipped Ran 1 test for test/OwnerUpOnly.t.sol:OwnerUpOnlyTest
[PASS] testFail_IncrementAsNotOwner() (gas: 8314)
Traces: [8314] OwnerUpOnlyTest::testFail_IncrementAsNotOwner() ├─ [0] VM::prank(0x0000000000000000000000000000000000000000) │ └─ ← [Return] ├─ [247] OwnerUpOnly::increment() │ └─ ← [Revert] Unauthorized() └─ ← [Revert] Unauthorized() Suite result: ok. 1 passed; 0 failed; 0 skipped; finished in 526.02µs (70.41µs CPU time) Ran 1 test suite in 2.91ms (526.02µs CPU time): 1 tests passed, 0 failed, 0 skipped (1 total tests) 为了确保将来我们回滚是因为我们不是所有者，让我们使用 expectRevert 作弊码： contract OwnerUpOnlyTest is Test { OwnerUpOnly upOnly; // ... // Notice that we replaced `testFail` with `test` function test_RevertWhen_CallerIsNotOwner() public { vm.expectRevert(Unauthorized.selector); vm.prank(address(0)); upOnly.increment(); }
} 如果我们最后一次运行 forge test，我们看到测试仍然通过，但这次我们确定如果因为任何其他原因回滚，它将始终失败。 $ forge test
No files changed, compilation skipped Ran 1 test for test/OwnerUpOnly.t.sol:OwnerUpOnlyTest
[PASS] test_IncrementAsOwner() (gas: 29161)
Suite result: ok. 1 passed; 0 failed; 0 skipped; finished in 478.13µs (70.15µs CPU time) Ran 1 test suite in 2.81ms (478.13µs CPU time): 1 tests passed, 0 failed, 0 skipped (1 total tests) 另一个可能不太直观的作弊码是 expectEmit 函数。在查看 expectEmit 之前，我们需要了解什么是事件。 事件是合约的可继承成员。当你发出一个事件时，参数会存储在区块链上。最多可以将事件的三个参数添加 indexed 属性，以形成称为“主题”的数据结构。主题允许用户在区块链上搜索事件。 pragma solidity 0.8.10; import "forge-std/Test.sol"; contract EmitContractTest is Test { event Transfer(address indexed from, address indexed to, uint256 amount); function test_ExpectEmit() public { ExpectEmit emitter = new ExpectEmit(); // Check that topic 1, topic 2, and data are the same as the following emitted event. // Checking topic 3 here doesn't matter, because `Transfer` only has 2 indexed topics. vm.expectEmit(true, true, false, true); // The event we expect emit Transfer(address(this), address(1337), 1337); // The event we get emitter.t(); } function test_ExpectEmit_DoNotCheckData() public { ExpectEmit emitter = new ExpectEmit(); // Check topic 1 and topic 2, but do not check data vm.expectEmit(true, true, false, false); // The event we expect emit Transfer(address(this), address(1337), 1338); // The event we get emitter.t(); }
} contract ExpectEmit { event Transfer(address indexed from, address indexed to, uint256 amount); function t() public { emit Transfer(msg.sender, address(1337), 1337); }
} 当我们调用 vm.expectEmit(true, true, false, true); 时，我们希望检查下一个事件的第 1 和第 2 个 indexed 主题。 test_ExpectEmit() 中的预期 Transfer 事件意味着我们期望 from 是 address(this)，而 to 是 address(1337)。这与从 emitter.t() 发出的事件进行比较。 换句话说，我们正在检查 emitter.t() 的第一个主题是否等于 address(this)。expectEmit 的第三个参数设置为 false，因为不需要检查 Transfer 事件的第三个主题，因为只有两个。即使我们设置为 true，也没有关系。 expectEmit 的第四个参数设置为 true，这意味着我们希望检查“非索引主题”，也称为数据。 例如，我们希望 test_ExpectEmit 中预期事件的数据（即 amount）等于实际发出事件中的数据。换句话说，我们断言 emitter.t() 发出的 amount 等于 1337。如果 expectEmit 的第四个参数设置为 false，我们将不会检查 amount。 换句话说，即使数量不同，test_ExpectEmit_DoNotCheckData 也是一个有效的测试用例，因为我们不检查数据。 📚 参考 请参阅 作弊码参考 以获取所有可用作弊码的完整概述。

