Forge 支持基于属性的测试。 基于属性的测试是一种测试通用行为而非孤立场景的方法。 让我们通过编写一个单元测试，找出我们正在测试的通用属性，并将其转换为基于属性的测试来理解这意味着什么： pragma solidity 0.8.10; import "forge-std/Test.sol"; contract Safe { receive() external payable {} function withdraw() external { payable(msg.sender).transfer(address(this).balance); }
} contract SafeTest is Test { Safe safe; // Needed so the test contract itself can receive ether // when withdrawing receive() external payable {} function setUp() public { safe = new Safe(); } function test_Withdraw() public { payable(address(safe)).transfer(1 ether); uint256 preBalance = address(this).balance; safe.withdraw(); uint256 postBalance = address(this).balance; assertEq(preBalance + 1 ether, postBalance); }
} 运行测试，我们看到它通过了： $ forge test
Compiling 24 files with Solc 0.8.10
Solc 0.8.10 finished in 1.17s
Compiler run successful! Ran 1 test for test/Safe.t.sol:SafeTest
[PASS] test_Withdraw() (gas: 19463)
Suite result: ok. 1 passed; 0 failed; 0 skipped; finished in 592.16µs (75.11µs CPU time) Ran 1 test suite in 3.11ms (592.16µs CPU time): 1 tests passed, 0 failed, 0 skipped (1 total tests) 这个单元测试确实测试了我们可以从安全合约中提取以太币。然而，谁又能说它对所有金额都有效，而不仅仅是 1 以太币呢？ 这里的通用属性是：给定一个安全余额，当我们提取时，我们应该得到安全合约中的所有以太币。 Forge 会将任何至少有一个参数的测试视为基于属性的测试，所以让我们重写： contract SafeTest is Test { // ... function testFuzz_Withdraw(uint256 amount) public { payable(address(safe)).transfer(amount); uint256 preBalance = address(this).balance; safe.withdraw(); uint256 postBalance = address(this).balance; assertEq(preBalance + amount, postBalance); }
} 如果我们现在运行测试，我们可以看到 Forge 运行了基于属性的测试，但对于高值的 amount 它会失败： $ forge test
Compiling 1 files with Solc 0.8.10
Solc 0.8.10 finished in 1.11s
Compiler run successful! Ran 1 test for test/Safe.t.sol:SafeTest
[FAIL. Reason: EvmError: Revert; counterexample: calldata=0x29facca70004c4c48afc26c4a597160d62929bba2ce21602a73927fca0d4153272d1d4cb args=[8425429329456584736079284567647927331458703889814200072693356035849704651 [8.425e72]]] testFuzz_Withdraw(uint256) (runs: 0, μ: 0, ~: 0)
Suite result: FAILED. 0 passed; 1 failed; 0 skipped; finished in 868.73µs (470.27µs CPU time) Ran 1 test suite in 3.57ms (868.73µs CPU time): 0 tests passed, 1 failed, 0 skipped (1 total tests) 默认情况下，测试合约被赋予的以太币数量是 2**96 wei（类似于 DappTools），所以我们必须将 amount 的类型限制为 uint96，以确保我们不会尝试发送超过我们拥有的数量： function testFuzz_Withdraw(uint96 amount) public { 现在它通过了： $ forge test
Compiling 1 files with Solc 0.8.10
Solc 0.8.10 finished in 1.15s
Compiler run successful! Ran 1 test for test/Safe.t.sol:SafeTest
[PASS] testFuzz_Withdraw(uint96) (runs: 257, μ: 19266, ~: 19631)
Suite result: ok. 1 passed; 0 failed; 0 skipped; finished in 4.81ms (4.38ms CPU time) Ran 1 test suite in 6.14ms (4.81ms CPU time): 1 tests passed, 0 failed, 0 skipped (1 total tests) 你可能希望使用 assume 作弊码排除某些情况。在这些情况下，模糊器将丢弃输入并开始新的模糊运行： function testFuzz_Withdraw(uint96 amount) public { vm.assume(amount > 0.1 ether); // 省略
} 有不同的方法来运行基于属性的测试，特别是参数化测试和模糊测试。Forge 仅支持模糊测试。

