不变性必须在给定的模糊活动过程中保持，但这并不意味着它们必须在每种情况下都成立。在某些情况下，可能会有某些不变性被引入/移除（例如，在清算期间）。 不建议在不变性断言中引入条件逻辑，因为它们有可能引入误报，因为代码路径不正确。例如： function invariant_example() external { if (protocolCondition) return; assertEq(val1, val2);
} 在这种情况下，如果 protocolCondition == true，则根本不会断言不变性。有时这可能是期望的行为，但如果 protocolCondition 在整个模糊活动中意外为真，或者条件本身存在逻辑错误，则可能会导致问题。因此，最好尝试为该条件定义一个替代不变性，例如： function invariant_example() external { if (protocolCondition) { assertLe(val1, val2); return; }; assertEq(val1, val2);
} 处理不同协议状态下的不同不变性的另一种方法是利用针对不同场景的专用不变性测试合约。这些场景可以使用 setUp 函数进行引导，但更强大的方法是利用 不变性目标 来控制模糊器以某种方式行为，从而仅产生某些结果（例如，避免清算）。

