此外，通过处理器，输入参数可以被限制为合理的预期值，使得 foundry.toml 中的 fail_on_revert 可以设置为 true。这可以通过 forge-std 中的 bound() 辅助函数来实现。这确保了模糊器进行的每个函数调用都必须对协议成功，才能通过测试。这对于可见性和确保协议以期望的方式进行测试的信心非常有用。 function deposit(uint256 assets) external { assets = bound(assets, 0, 1e30); asset.mint(address(this), assets); asset.approve(address(token), assets); uint256 beforeBalance = asset.balanceOf(address(this)); uint256 shares = token.deposit(assets, address(this)); assertEq(asset.balanceOf(address(this)), beforeBalance - assets); sumBalanceOf += shares;
} 这也可以通过从专用“无界”处理器合约继承非有界函数来实现，这些合约可用于 fail_on_revert = false 测试。这种测试也很有用，因为它可以揭示 bound 函数使用中假设的问题。 // 无界
function deposit(uint256 assets) public virtual { asset.mint(address(this), assets); asset.approve(address(token), assets); uint256 beforeBalance = asset.balanceOf(address(this)); uint256 shares = token.deposit(assets, address(this)); assertEq(asset.balanceOf(address(this)), beforeBalance - assets); sumBalanceOf += shares;
} // 有界
function deposit(uint256 assets) external { assets = bound(assets, 0, 1e30); super.deposit(assets);
}

