在上面的函数调用中，可以看到 address(this) 是 ERC-4626 合约中的唯一存款者，这并不是其预期用途的真实表示。通过利用 forge-std 中的 prank 作弊代码，每个处理器可以管理一组参与者，并使用它们从不同的 msg.sender 地址执行相同的函数调用。这可以通过以下修饰符实现： address[] public actors; address internal currentActor; modifier useActor(uint256 actorIndexSeed) { currentActor = actors[bound(actorIndexSeed, 0, actors.length - 1)]; vm.startPrank(currentActor); _; vm.stopPrank();
} 使用多个参与者还允许更细粒度的幽灵变量使用。这在下面的函数中有所展示： // 无界
function deposit( uint256 assets, uint256 actorIndexSeed
) public virtual useActor(actorIndexSeed) { asset.mint(currentActor, assets); asset.approve(address(token), assets); uint256 beforeBalance = asset.balanceOf(address(this)); uint256 shares = token.deposit(assets, address(this)); assertEq(asset.balanceOf(address(this)), beforeBalance - assets); sumBalanceOf += shares; sumDeposits[currentActor] += assets
} // 有界
function deposit(uint256 assets, uint256 actorIndexSeed) external { assets = bound(assets, 0, 1e30); super.deposit(assets, actorIndexSeed);
}
